  return (
    <div>
      <Typography variant="h1" component="h2" gutterBottom>
        Wallet details
      </Typography>
      <Divider />
      <Typography variant="h5" gutterBottom>
        Wallet details
      </Typography>
      <h4>address</h4>
    </div>
  );
}
